import React from "react";
import { Link } from "react-router-dom";

const ProductPage = () => {
  return (
    <>
      <h1>Product Page</h1>
      <ul>
        <li>Product 1</li>
        <li>Product 2</li>
        <li>Product 3</li>
      </ul>
      <p>
        go to Home,<Link to="/">click here.</Link>
      </p>
    </>
  );
};

export default ProductPage;
